public class InnerFirewallPolicyFirewallPolicyFactory(Action<Humidifier.NetworkFirewall.FirewallPolicyTypes.FirewallPolicy> factoryAction = null) : SubResourceFactory<Humidifier.NetworkFirewall.FirewallPolicyTypes.FirewallPolicy>
{

    internal List<InnerFirewallPolicyStatelessRuleGroupReferenceFactory> StatelessRuleGroupReferencesFactories { get; set; } = [];

    internal List<InnerFirewallPolicyStatefulRuleGroupReferenceFactory> StatefulRuleGroupReferencesFactories { get; set; } = [];

    internal List<InnerFirewallPolicyCustomActionFactory> StatelessCustomActionsFactories { get; set; } = [];

    internal InnerFirewallPolicyStatefulEngineOptionsFactory StatefulEngineOptionsFactory { get; set; }

    internal InnerFirewallPolicyPolicyVariablesFactory PolicyVariablesFactory { get; set; }

    protected override Humidifier.NetworkFirewall.FirewallPolicyTypes.FirewallPolicy Create()
    {
        var firewallPolicyResult = CreateFirewallPolicy();
        factoryAction?.Invoke(firewallPolicyResult);

        return firewallPolicyResult;
    }

    private Humidifier.NetworkFirewall.FirewallPolicyTypes.FirewallPolicy CreateFirewallPolicy()
    {
        var firewallPolicyResult = new Humidifier.NetworkFirewall.FirewallPolicyTypes.FirewallPolicy();

        return firewallPolicyResult;
    }
    public override void CreateChildren(Humidifier.NetworkFirewall.FirewallPolicyTypes.FirewallPolicy result)
    {
        base.CreateChildren(result);

        result.StatelessRuleGroupReferences = StatelessRuleGroupReferencesFactories.Any() ? StatelessRuleGroupReferencesFactories.Select(x => x.Build()).ToList() : null;
        result.StatefulRuleGroupReferences = StatefulRuleGroupReferencesFactories.Any() ? StatefulRuleGroupReferencesFactories.Select(x => x.Build()).ToList() : null;
        result.StatelessCustomActions = StatelessCustomActionsFactories.Any() ? StatelessCustomActionsFactories.Select(x => x.Build()).ToList() : null;
        result.StatefulEngineOptions ??= StatefulEngineOptionsFactory?.Build();
        result.PolicyVariables ??= PolicyVariablesFactory?.Build();
    }

} // End Of Class

